import React from 'react'
import Fire from './fire-logo.svg';
import FireIntro from './california.jpg';

export const Nav = ({sticky}) => {
    return(
        // <nav id={sticky ? "navbar navbar-sticky" : "navbar"}>
            <div id = "main-menu">
                <div id = "logo">
                    {sticky ? <img src={Fire} className="fire-logo" alt="fire logo"/> : null}
                </div>
                <div id="nav">
                    <ul>
                        <li><a href = "#home">Home</a></li>
                        <li><a href = "#history">History</a></li>
                        <li><a href = "#prediction">Prediction</a></li>
                        <li><a href = "#prevention">Prevention</a></li>
                        <li><a href = "#community">Community</a></li>
                        <li><a href = "#about">About</a></li>
                    </ul> 
                </div>
            </div>
        // </nav>
    )
}

export const Intro = () => {
    return(
        <div id = "overlay">
            <div>
                <img src={FireIntro} id="fire-intro" alt = "fire intro"/>
            </div>
        </div>
    )
}
